import React from 'react';

class Counter extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      toggle: false,
    };
  }

  render() {
    return (
      <div>
        <h1>Trung</h1>
        <button></button>
      </div>
    );
  }
}

export default Counter;
